import React from 'react'

function Submit(props) {
    return (
        <>
          <div className="postUpload_body">
            <div className="postUpload_container">
              <textarea
                placeholder="Type Title"
                value={props.inbox.Post_txtTitle}
                onChange={props.inbox.TxtTitle}
                className="postUpload_title"
              ></textarea>
              <textarea
                placeholder="Type here"
                value={props.inbox.Post_textarea}
                onChange={props.inbox.TxtChange}
                className="postUpload_textarea"
              >
                {" "}
              </textarea>
            </div>
          </div>
        </>
      );
}

export default Submit
